import React, { Component } from "react";

class Home extends Component
{
    render()
    {
        return(
            <div>
                <div className="jumbotron">
                    <div className="container text-center">
                        <h1>Welcome to <b>WAAS</b> portal</h1>
                        <p></p>
                    </div>
                </div>
            </div>
        )
    }
}
export default Home;
